import React from "react";
import NavBar from "./NavBar";
import About from './About'
import Contact from './Contact'
import Error from './Error'
import './RR.css'
import { Routes,Route } from "react-router-dom";
const RootRender = (()=>{
    return(
        <>
          <NavBar/>    
          <Routes>
            <Route exact path="/contact/about" element = {<About name = "About"/>}/>
            <Route exact path="/contact" element = {<About name = "Contact"/>}/>
            <Route path='/*' element = {<About name = "Error"/>}/>
        </Routes>
        </>
    )
})
export default RootRender
